# 1. Проанализировать скорость и сложность одного любого алгоритма из разработанных в рамках домашнего задания первых трех уроков.
# Примечание. Идеальным решением будет:
# a. выбрать хорошую задачу, которую имеет смысл оценивать,
# b. написать 3 варианта кода (один у вас уже есть),
# c. проанализировать 3 варианта и выбрать оптимальный,
# d. результаты анализа вставить в виде комментариев в файл с кодом (не забудьте указать, для каких N вы проводили замеры),
# e. написать общий вывод: какой из трёх вариантов лучше и почему.

# Урок 3. Задача 4
# 4. Определить, какое число в массиве встречается чаще всего.

# 1 метод
from typing import List

def most_number(num_list):
    num_list.sort()
    prev = 0
    cnt = 0
    prev_max = 0
    max_el = 0
    num_list.append(0)
    i=0
    for current in num_list:
        if i == 0:
            cnt = 1
            prev = current
            i=1
            continue
        if current != prev:
            if cnt >= prev_max:
                prev_max = cnt
                max_el = prev
            prev = current
            cnt = 1
        else:
            cnt += 1
    return max_el

# 2 метод
def most_number_2(num_list):
    items = {}
    for current in num_list:
        if current in items:
            items[current] = items[current] + 1
        else:
            items[current] = 1
    max = 0
    key = 0
    for k, v in items.items():
        if v > max:
            max = v
            key = k
    return key

# 3 метод
def most_number_3(num_list:List):
    arr = list(set(num_list))
    cnt_el = float('-inf')
    el =0
    for a in arr:
        cnt = num_list.count(a)
        if cnt > cnt_el:
            cnt_el = cnt
            el = a

    return el


# метод тестирование
def test_most_number(func):
    test_list = [1, 3, 5]
    in_list = [[1, 1, 1, 1, 1, 2, 3, 4, 5],
               [3, 3, 3, 5, 6, 3, 3, 7, 8],
               [1, 2, 3, 4, 3, 3, 5, 5, 5, 5, 5]]
    for k, t in enumerate(test_list):
        assert t == func(in_list[k])
        print(t, f'OK {func.__name__}')
    print('-' * 10)


test_most_number(most_number)
test_most_number(most_number_2)
test_most_number(most_number_3)

